  false,\n\t\"url\": null,\n\t\"notes\": \"Helium and Tritium data from the North
  Atlantic ocean was submitted bynDr. William Jenkins from Woods Hole Oceanographic
  Institution (WHOI). The data werencollected from October 17 to November 2, 1979
  during cruise 107 of thenATLANTIS II. the data are in the originators format which
  is describednin the documentation. The first depth was too deep to be able to convertnto
  F022 or station data formats. Helium concentration was measured asnncc(STP)/gram
  H2O. Oxygen was in um/kg. Tritium was measured as tritiumnunits (1 tritium atom
  = 10 to the eighteenth hydrogen atoms).\",\n\t\"owner_org\": \"e811f0b4-451f-4896-9e8f-fc6802837819\",\n\t\"extras\":
